        "desc_loc": "Bloodseeker is invigorated by the wounds of his enemies, restoring some life when he kills a unit. Restores for half values when denying, or if an ally kills a nearby enemy hero. Also gains bonus movement speed when an enemy hero's health falls below %min_bonus_pct%%%, with the bonuses increasing as their health falls further. If an enemy hero's health falls below %invis_threshold_pct%%%, he will also gain vision and True Sight of that hero. Bonuses stack per hero. Unlocks max movement speed for Bloodseeker.",
        "lore_loc": "Strygwyr becomes frenzied when blood is spilled.",
        "notes_loc": [
          "Not triggered by Illusions.",
          "Max movement speed bonus occurs when an enemy's health is at or below %max_bonus_pct%%%.",
          "Effects linger for %linger_duration% seconds if a target dies."
        ],
