        "name": "skeleton_king_reincarnation",
        "name_loc": "Reincarnation",
        "desc_loc": "Wraith King's form regroups after death, allowing him to resurrect when killed in battle.  Upon death, enemy units in a %slow_radius% radius will be slowed, and spawn %shard_skeleton_count% skeleton(s) to attack each nearby enemy hero. Can be self-cast to kill Wraith King instantly.",
        "lore_loc": "Conspirators against the Wraith King wonder why he never stays dead.",
        "notes_loc": [
          "Wraith King won't revive if he doesn't have enough mana.",
          "If Wraith King has an Aegis and Reincarnation off cooldown, Reincarnation will trigger first.",
          "Revives with full HP and Mana.",
          "Credit for allies whose death was delayed will go to whoever struck the original killing blow.",
          "Wraith Delay affects Wraith King's actual deaths, not Reincarnate deaths."
        ],
        "shard_loc": "Causes Reincarnation to have no mana cost and increases Skeleton Spawn count.",
