        "notes_loc": [
          "Illusions are destroyed on the first tick of damage."
        ],
        "shard_loc": "Life Drain can target your Nether Ward, causing life drain to refract to all enemy heroes within %abilitycastrange% units of the ward for %shard_damage_pct_from_ward%%% of its normal value. The effect is interrupted if the ward is destroyed.",
