        "id": 5225,
        "name": "luna_eclipse",
        "name_loc": "Eclipse",
        "desc_loc": "Showers random nearby enemies with strikes from Luna's current level of Lucent Beam. These beams do not stun their targets, and there is a maximum number of times that a single target can be struck. Also turns day into night for a short time.",
